    description:
      "무술로 전설이 된 영웅, 이소룡을 만나다!\n정무문, 맹룡과강 등을 연이어 히트시킨 최고의 스타이자 액션의 원조 이소룡의 일대기를 다룬 드라마.\n\n사립 학교에 다니는 경극 배우 이해천의 아들 소룡은 학업에는 관심이 없다. 소룡은 여자친구 진소만과 차차차 댄스 대회에 우승하지만, 영국인 학생 블레어에게 두들겨 맞고 심지어 “동아시아의 병자”라는 치욕스러운 말까지 듣는다. 이에 격분한 소룡은 무술을 배우게 해달라며 아버지를 조르고 결국 영춘권 대가인 엽문 사부님의 제자로 들어간다. \n홍콩 학생 복싱대회에서 우승한 소룡은 중국인 상인들을 보호하려다 폭력배 두목 왕력조와 대립하게 되고 아버지는 소룡에게 자신의 친구 소여해와 미국에 가라고 한다. 미국에 도착한 소룡은 식당에서 일하며 학업을 병행한다. 미국에 도장을 연 소룡은 쿵후를 널리 알리고자 여러 나라 무술 고수들과 대결하며 영춘권의 단점을 보완해간다. 전미 가라데 대회 우승으로 영화계에 진출한 소룡은 단역부터 시작하여 점차 비중 있는 배역을 맡게 된다.",
