    href: "https://www.tving.com/contents/P001567238",
    img: "https://image.tving.com/upload/cms/caip/CAIP0900/P001567238.jpg/dims/resize/480",
    ott: "TVING",
    description:
      "초나라 공주 마복아는 천진난만하고 착한 소녀로, 가난한 사람들에게 의술을 행하여 모든 백성에게 칭송을 받는다. 마복아는 군량을 훔쳐 사형에 처하게 된 어린 소년을 구해 주고, 병사들에게 쫓기게 된다. 도망치던 마복아는 한나라(북한) 태자 유연성의 처소로 들어가고, 그의 도움으로 무사히 탈출한다. \r\n하지만 초나라에 궁중 정변이 일어나며 황제의 아우인 정왕이 황위를 찬탈하고, 마복아는 하루 아침에 부모님을 잃고 동생의 생사도 알지 못하게 된다. 마복아는 도움을 청하기 위해 한나라 태자 유연성을 찾아가지만, 화친 혼인으로 태자비가 된 정왕의 딸 마상운이 둘의 만남을 방해하고, 마복아를 절벽에서 떨어뜨려 죽인다.\r\n마복아는 맹기우라는 사람의 도움을 받아 천신만고 끝에 목숨을 구하고, 더는 순진하게 당하지 않고 부모와 나라의 원수를 갚겠다고 맹세한다. 맹기우는 마복아에게 복수를 도와주겠다며 거래를 제안한다. 마복아는 맹기우의 계획대로 반옥이라는 이름으로 촉나라 황궁에 궁녀로 들어가고, 그제야 맹기우가 폐태자라는 걸 알게 된다. 맹기우는 마복아에게 태자 맹기성의 눈에 들어 태자비가 되고, 자신의 황위를 돌려달라고 한다. \r\n장난을 좋아하는 어린 태자 맹기성은 마복아의 활달한 매력에 빠지고, 마복아를 태자비로 삼겠다고 한다. 하지만 황후 두비홍은 자신의 조카 두완을 태자비로 만들기 위해 계략을 꾸민다. 황후의 마수를 피해 여러 차례 고비를 넘긴 마복아는 차갑기만 하던 맹기우가 자신을 위해 애쓰는 걸 보고 점차 사랑을 느끼게 된다. 복수만을 생각하던 냉혈한 맹기우도 마복아에게 이끌리고 두 사람은 서로의 감정을 확인한다. \r\n\r\n한편, 마복아를 잊지 못하던 유연성은 마복아가 촉나라 황궁에 있다는 걸 알게 되고, 전쟁을 일으킬 준비를 하는데…",
