    description:
      "이루어라. 그대가 바라는 것을.′\r\n\r\n한때 세계를 구했던 영웅들이 있었다. 수많은 영웅들은 ′파괴′의 힘에 맞서 싸웠고, 이 세계를 지켜내었다.\r\n그리고 시간이 흘렀다.\r\n\r\n영웅들은 역사의 저편으로 떠나갔고, 그들의 힘을 몸에 깃들게 해 싸우는 ′계승자′라 불리는 소년 소녀들에게\r\n세계의 운명은 맡겨졌다. ′계승자′들의 정점에 선 ′세븐나이츠′ 중 한 명인 파리아라는 소녀는 몰려드는 \r\n파괴의 군세와 싸우던 가운데 네모라는 소년을 구하게 되었다. \r\n\r\n격전이 한창인 가운데, 네모는 자신도 모르는 가운데 영웅의 힘을 환기하고 ′계승자′로서 그 힘을\r\n발휘한다. 하지만, 그의 영웅은 누구도 알지 못하고 누구도 말하지 않는 자였다. \r\n\r\n그리고 이때부터 시작되었다. \r\n과거와 현재가 교차하는 영혼의 여행길은.",
