      "마계에서 마왕 다음의 2인자로서의 지위를 뽐내던 쟈히 님. 마족들의 경외를 받으면서, 뭐든지 말하는 대로 이루어지고 사치도 있는 대로 부릴 수 있는 형편 좋은 나날들을 누리고 있었지만, 마법소녀의 습격을 받아 인간계로 날려 보내지고 말았다.\r\n\r\n마력의 근원인 마석이 부서져버려 권력도 미모도 한순간에 사라진 채 쪼끄맣고 귀여운 모습으로 전락해버리고 말았다. \r\n빈곤한 생활을 강요받으면서, 욕실도 없는 두 평 남짓한 방에서 지내며 요리 주점 아르바이트를 하는 나날들.  \r\n\r\n동정도 집세 독촉도 모두 떨쳐내고, 야망은 성대하게 ′마계 부흥′을 이루는 것!\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n",
