    description:
      "한 동안 잠잠하다 했더니, 톱스타 서준이 또 일을 쳤다. 이번엔 폭행이란다...! 그냥 스캔들과는 차원이 다른 문제였다. 윤리적인 문제도 있었고 이미지 타격도 컸다. 당분간 활동은 글렀다 생각한 필현은 서준을 다른집으로 도피시키기로 했다. 바로, 지우가 세 들어 살고 있는 그 집으로! 그러나 두 사람은 처음 본 사이가 아니었다. 그날 아침, 서준이 도로 위에서 급하게 화장실이 필요해 아무 레스토랑으로 뛰어 들어갔던 그 때, 오픈 준비를 하고 있던 쉐프가 지우였다. 자기 볼 일만 보고 그 날의 첫 요리를 버려달라고 부탁한 서준에 꽤나 기분이 상해있었는데, 집에서 본 서준은 더 최악이었다. 샤워 후 먹기 위해 냉장고에 두었던 맥주를 다 마셔버리질 않나. 집에 처음보는 매니저를 부르질 않나.. 심지어 모든 것을 돈으로 보상해준단다. ′′잘못을 했으면 사과가 먼저죠.′′ ′′그건 맥주 네 캔에 만원을 줄 때고. 나는 보통금액의 열배를 주는데?′′ 어차피 세 들어 사는 집이라, 지우에게 나가라 마라 할 권한도 없었고, 지우는 그냥 서준을 상종하지 않고 살아야겠다 다짐한다. 그러나, 낯가림이라곤 1도 없는 서준 끊임없이 지우에게 말을 걸기 시작한다. 요리를 하는 지우 옆에 와서 자신도 같이 먹자, 나 오늘 피자 먹었는데 매운 거 먹음 안돼? 뻔뻔한 말을 잘도 하는 서준. 결국 지우가 모든 것을 포기하고 술 안주, ′바지락 술찜′을 건네는데...",
