    description:
      "이것은 아주 먼 옛날의 이야기. 아니, 이것은 까마득한 미래의 이야기.\r\n그 땅에 인류의 모습은 없고, 인간을 닮은 인간이 아닌 자들이 가난하지만 소박하게 살아가고 있었다.\r\n\r\n그들은 노래한다. 한때 이 땅에 신들의 전쟁이 있었다는 것을.\r\n전쟁의 불길은 여러 나라를 끌어들였고, 모순적이지만 격돌에 의해 진정한 모습을 되찾은 신은 재앙의 원흉이 자신임을 깨닫고 스스로 깊은 잠에 들었다. 어여삐 여기는 자들과 새로운 생명을 남기고서...\r\n\r\n우연인가 혹은 운명인가, 두 개의 길은 해후하고 이윽고 수많은 빛이 모였다.\r\n하지만 태양은 가라앉고 유달리 빛나는 별 또한 져간다. 그 빛을 꺼뜨리지 않기 위해 하얀 자는 거짓의 가면을 집어 들어 스스로 이름을 버리고, 영원한 자는 하얀 자를 잃고 공허한 마음을 헤매며 걷는다.\r\n\r\n마주치는 길이 엇갈린 지금, 커다란 전쟁의 불길이 이 땅을 뒤덮으려 하고 있었다.",
