      "당신의 ‘수요일 오후 3시 30분’을 위한 이야기가 펼쳐진다!\r\n\r\n영국의 모 화장품 회사가 2013년도에 발표한 연구조사에 따르면, 여성이 가장 늙어 보이는 시간은 수요일 오후 3시 30분이라고 한다. 스트레스와 피로가 정점에 달하고, 주말의 과음과 불면이 피부상태로 드러나는 시간이라는 것.\r\n지난 주말에서 이미 너무 멀어졌고 다음 주말까지는 까마득한,\r\n망망대해의 한 복판에 서 있는 것 같은 수요일,\r\n점심시간이 지난 지는 꽤 되었고, 퇴근시간은 아득한 오후 3시 30분.\r\n연구 결과의 정확성을 굳이 따지지 않더라도,\r\n그 심리적 피로감에 대해서는 아마 많은 사람들이 공감할 수 있을 것이다.\r\n\r\n그리고 어쩌면, 우리의 인생에도- 그런 때가 있을 것이다.\r\n열심히 살아왔다고 생각했는데 문득 돌아보니 아무것도 남은 것이 없다고 느껴질 때.\r\n출발선을 떠난 지는 한참 되었건만 목적지까지는 아직도 너무 많이 남은 것 같아 막막할 때.\r\n그리고… 영원할거라고 믿었던 사랑이 나를 떠났을 때. \r\n\r\n그리하여 여기, 인생의 ‘수요일 오후 3시 30분’을 보내고 있는 한 여자의 이야기를 통해\r\n세상 모든 이들의 ‘수요일 오후 3시 30분’을 위로하고자 한다.\r\n\r\n시간은 누구에게도 예외 없이 어김없이 흐르고 힘든 순간은 지나가기 마련이라고. \r\n그러므로- ‘수요일 오후 3시 30분’을 씩씩하게 잘 버텨낸\r\n당신 앞엔 이제, 예뻐질 일만 남았다고 말이다.",
