    description:
      "상앙의 변법이후 진나라는 새로운 시기로 접어들어 열국들이 무시하지 못할 정도로 우뚝 서게 된다. 진 혜문왕이 상앙을 죽이고도 신법을 그대로 유지하자 진 내부의 보수 세력들은 물론 외부의 다른 국가들도 태도에 변화를 보이기 시작한다.    \r\n피바람을 예고하는 분위기가 무르익는 가운데 제와 위왕이 진 혜문왕을 상왕대례에 초대하자 진 혜문왕은 오히려 제, 위, 진 삼국의 상왕을 제안하여 삼국 상왕의 예를 올리기로 한다. 이 엄청난 제안으로 인해 진 혜문왕은 먼저 위왕의 지시를 받은 자객에게 습격을 당하고 위왕의 협박을 받은 위서에게 혼례날 암살당할 위기에 빠진다. \r\n또한 이 때를 이용하여 감룡, 두지 등 보수 집단은 위, 의거와 내통해 새 군주를 세우고 상앙의 신법을 폐하려 한다. 하지만 진 혜문왕은 신속한 대처로 제, 위 결맹을 파훼시키고 의거군을 해산시켜 감룡 일족의 복고 음모를 파훼시킨다. 이렇듯 진이 강대해 질수록 열국은 극도의 공황에 빠지게 되는데... \r\n전국 시기는 도전과 기회의 시기였다. 많은 영웅 재사들이 분분히 나타났으며 각국의 관계는 끊임없이 재조합되었다. 서수는 진을 떠나 위로 가서 6국이 합종을 통해 진에 대항할 것을 유세하자 진은 대위기에 빠진다. 이에 젊은 진나라의 군주는 과감하게 장의를 임용하는데 이는 진 효공이 상앙을 등용한 것처럼 또 한 번 천고에 미담으로 전해질 사건이었다. 이로써 장의는 합종, 연횡을 분열시켜 외교적 곤경과 위험을 돌파하며 화하의 외교역사에 화려한 장을 쓰게 되고 수 천 년이 지난 오늘날 까지도 감탄을 자아내게 만든다. \r\n진 혜문군은 내적으론 경작과 전쟁을 장려하고 대외적으론 외교적 곤경을 돌파하기 위한 교섭과 공격을 병행하여 때론 곤경에 빠지기도 하지만 엎치락 뒤치락하는 전투를 통해 동쪽으로는 함곡. 남쪽의 상어와 서쪽의 파촉을 정벌하고 북으로 의거를 복속시켜 빛나는 역사의 한 페이지를 장식한다.",
