    description:
      "기원전 4세기 중엽, 중국 서부는 정치적 격변의 장이었다. 서양의 고대 그리스 문명이 전성기를 누리던 시기로, 동양의 중국 대륙에서는 청동기 시대를 끝내고 거대한 문명 변화를 겪고 있었다. 중국 서부의 약소 제후국이었던 진국은 동부의 6개 강대 제후국의 끊임없는 압박과 침략에 시달린 끝에 망국의 위기에 처한다. 진국 군주 진효공은 잇단 침략에 따른 굴욕에서 벗어나기 위해 동부의 인재를 불러들여 나라의 발전을 꾀한다.   \r\n뛰어난 전략가이자 정치가인 상앙(위앙)은 비밀리에 진국으로 들어가 뜻을 펼칠 곳임을 확신하고 성심을 다해 진효공을 도와 부국 정책을 이끈다. 20여 년에 걸친 변혁을 통해 진국은 법치 제도를 완비하고, 제도 면에서 가장 강력한 강대국으로 도약한다. 이로써 중국은 통일 국가로서 변모할 문명적 기틀을 마련하게 되는 것이다. 그러나 이 대변혁을 주도했던 두 주인공, 상앙과 진효공은 비극적 운명을 맞이하며 역사의 소용돌이로 사라진다.",
