    ott: "TVING",
    description:
      "조순일가의 멸족사건을 다룬 드라마로 ′도안고′가 조씨 일가에게 행한 참혹한 진상이 들어나고 결국 적의 양아들로 자라나 복수에 성공하는 복수극의 드라마이다.춘추전국시대, 진나라 영공의 손자 경공(景公)은 궁궐 내에 영공을 시해한 왕위 찬탈 반란사건이 벌어지자, 간신 도안고에게 권신이었던 조순과 그의 일가를 모두 멸족하라 명을 내린다. 이때, 조삭의 아내인 장희가 사내 아이인 조무를 낳게 되는데… 조씨 일가를 모두 멸족하였지만 막 태어난 아이인 조무의 행방을 찾지 못한 도안고는 도성의 모든 갓난아이를 죽이라는 명령을 내린다. 이렇게 도성의 아이들이 죽임 당하는 것을 지켜보던 정영은 자신의 친 아들을 조무라고 속여 도안고에고 데리고 가고 자신의 친아들을 죽임으로써 도성 아이들의 죽음을 막는다. 이렇게 정영은 자신의 친아들을 희생하고 조씨 가문의 마지막 혈육인 조무를 구한다. 그리고 조무를 자신의 친아들처럼 키우고, 계획적으로 도안고와 가깝게 지내면서 도안고를 향한 복수의 때를 기다린다. 세월이 흘러 도안고의 아들 저월은 문무능력을 모두 갖춘 진나라 정권의 떠오르는 인재가 된다. 그러던 어느날, 저월이 도안고의 친 아들이 아니라, 조씨 가문의 마지막 혈육이라는 소문이 퍼지고,,, 저월과 함께 정영의 아들 정대업게게도 의심의 화살이 가는데... 조씨고아 조무에 대한 진실이 하나씩 밝혀지면서 과거에 도안고가 조씨 일가에게 행한 참혹한 멸족 사건의 진상이 낱낱이 드러나기 시작하는데..",
