    img: "https://image.tving.com/ntgs/contents/CTC/caip/CAIP0900/ko/20230106/P001684997.jpg/dims/resize/480",
    ott: "TVING",
    description:
      "이상 기후에 의한 급격한 기온 상승의 영향으로 지상의 대부분이 수몰된 세계. World Government <세계 통치 기구>에 의해 관리되고 인구 감소 때문에 노동을 로봇이나 안드로이드가 담당하게 하자는 의견이 제창되었다.\r\n\r\n그리고 도시 변두리에 있는 어떤 빈집. 사람들에게서 잊힌 이 공동 주거 공간에는 어째선지 주인 없는 네 명의 안드로이드인 코발트, 케이, 크롬, 네온이 살고 있었다.\r\n\r\n그런 그들에게 어떤 문제가 발생한다.\r\n ′전기 요금을 못 낸다는 건충전 불가능?′ ′그렇다는 건..... 강제 셧다운!?′ \r\n전기 요금 지불을 위해 그들은 신시대의 상징으로 우뚝 선 엔터테인먼트 타워 ′바벨′에 도전한다.\r\n\r\n′바벨′은 클라이머라고 불리는 아티스트들이 보여주는 클라임 스테이지에 열광하고 마음을 뒤흔드는 감동을 느끼며 정상을 향해 도전하는 장소. 햇빛의 즐거움을 잃어버린 인간들이 새로이 발견한 희망의 엔터테인먼트 타워였다.\r\n\r\n절대 왕좌 STAND-ALONE이 군림하고 있는 바벨에서 안드로이드들은 가창 퍼포먼스로 스테이지를 클리어해서 상금을 획득하려 한다.\r\n\r\n첫 바벨 도전을 마치고 돌아오는 길, 그들은 한 명의 천재 소년과 만난다. 소년의 마음에 닿은 순간 갑자기 네 명 안에서 특별한 프로그램이 작동한다.\r\n\r\n인간과 안드로이드, 과거와 현재, 얽힌 운명의 실이 풀렸을 때\r\n그들의 노랫소리가 퍼뜨리는 것은 절망일까 희망일까.\r\n\r\n네 명의 안드로이드들이 한 명의 천재 소년 에소라와 운명적으로 만났을 때 인간과 로봇의 미래를 향한 미지의 문이 열린다.\r\n\r\n그리고 꿈을 잊은 인간들의 마음에 그들의 노래가 울려 퍼진다.\r\n\r\n′괜찮아. 분명 다시 만날 수 있어.\r\n설령 어떤 곤란이 찾아와도′\r\n운명을 손에 넣기 위해서′",
