    ott: "TVING",
    description:
      "11살의 소녀와 15살의 소년. 최후의 전쟁 이후 살아가는 이들의 운명은 과연?\r\n\r\n최후의 전쟁 때에 발견되고 사용되었던 인체발화병원체. 그 생물 병기에 의해 바뀌고 만 인류는 곁에서 불이 타오르는 것만으로 인체가 발화하고 죽음에 이르게 되었다. 인간이 불이 주는 빛과 에너지를 잃어버린 세계.\r\n\r\n안전하게 사용할 수 있는 유일한 연료이기도 한, 이형의 짐승들인 ′염마′의 체액을 모으는 ′불 사냥꾼′이 살아남은 인류의 생활을 지탱하는 가운데 그들의 귀에 어떤 소문이 들리게 되었다.\r\n\r\n′최후의 전쟁 전에 쏘아 올려졌으며 오랬동안 허공을 떠돌던 인공 별, ′흔들불′이 돌아온다. 그리고 ′흔들불′을 사냥한 불 사냥꾼은 ′불 사냥의 왕′이라 불리게 될 것이다′\r\n\r\n어느 날, 약을 찾기 위해 결계로 보호되고 있는 마을에서 숲으로 들어간 11살인 토우코. 그녀는 갑자기 나타난 염마의 습격을 받게 되었으나, 낯선 남자 불 사냥꾼인 하이쥬가 그녀를 구해주었다. 하지만 하이쥬는 불 사냥꾼의 개인 카나타와 금빛으로 빛나는 낫, 그리고 지킴이 돌을 남기고 명을 다했다.\r\n\r\n같은 때, 얼마 남지 않은 문명의 흔적에 의지해 사람들이 살아가는 수도에서 나고 자란 15살의 소년 코우시는 언제 돌아올 지 모르는 아버지 대신에 공장 독에 죽은 어머니를 떠나보냈다. 날 때부터 병약한 여동생 히나코를 이젠 홀로 지켜야만 하는 그는 어떤 계획에 힘을 보태기로 마음 먹었다. \r\n\r\n토우코와 코우시. 운명에 이끌린 두 사람의 만남이, 세계의 비밀을 점점 밝혀나가게 되는데. \r\n",
