      "꿈이 현실로! 이것은 내가 최고의 히어로가 되기까지의 이야기다. 어떤 사건을 계기로 No.1 히어로 올마이트와 만난 ‘무개성’ 소년 미도리야 이즈쿠. 그의 마음속에 숨겨진 히어로의 자질을 발견한 올마이트에게 개성 ‘원 포 올’을 이어받는다. 미도리야는 올마이트의 혹독한 훈련을 거쳐서 유에이 고교에 입학한다. 바쿠고 카츠키, 우라라카 오챠코 등의 1학년 A반 친구들과 서로를 향상시키며 성실한 나날을 보내고 있었다. 그런 가운데 나라 전체가 주목하는 빅 이벤트 ‘유에이 고교 체육대회’ 개최가 다가온다. 오직 정상만을 바라보는 바쿠고, 가족을 그리워하며 강한 의지로 도전하는 우라라카와 이이다 텐야. 그리고 한 남자를 부정하기 위해서 우승을 노리는 토도로키 쇼토. 게다가 히어로과 1학년 B반을 비롯한 새로운 친구들까지, 유에이 고교 학생 전원이 투지를 불태우고 미도리야도 결의를 새로이 한다. “나도 최선을 다해 쟁취하겠어!” 최고의 히어로를 향한 그들의 개성과 힘, 그리고 자존심이 맞부딪히는 싸움이 시작된다!\t\r\n",
