    description:
      "‘공대 꽃뱀 자살 사건’이라는 자극적인 뉴스 헤드라인. 그리고 뒤따르는 유튜브 자살 영상. 그 주인공은 바로 공대 대학원 조교로 근무했던 김서연이다. 서연은 어느 날 학과 송년회에서 선배 윤정욱에게 대학원 조교 자리를 권유받게 된다. 형편도 좋지 않고, 하반기 공채에 모두 낙방한 서연은 성적 우수 장학금과 연구비라는 정욱의 말에 대학원 진학을 고려한다. 하지만 정욱은 김상헌 교수의 갑질에 못이겨 서연에게 조교자리를 떠넘긴 것이었고, 서연이 대학원에 진학했을 때 이미 정욱은 자리에 없다. 연구와 논문은 뒷전이고 김 교수의 딸을 위해 아이돌 콘서트 티켓팅에 가슴을 졸이고, 심지어 김 교수가 편히 운전을 할 수 있도록 내비게이션을 읽는 등 갑질에 시달리던 서연은 김 교수의 차에서 깜빡 잠들었다가 성추행을 당하게 된다. 자신을 거부하는 서연에게 김 교수는 학자금 대출과 취업을 운운하며 정당화를 하고, 벗어날 수 없는 서연은 급기야 김 교수의 연구실에서 성폭행을 당하게 된다. 서연은 박사과정에 재학 중인 선배 모규원에게 도움의 손길을 청하지만, 후환을 두려워한 규원은 서연을 외면한다. 정욱 역시 전화를 받지 않고 홀로 남겨진 서연은 페이스북 페이지 ‘대나무숲’에 자신의 마지막 목소리를 전한 채 학교 옥상으로 향한다.",
