    ott: "TVING",
    description:
      "격년으로 열리는 차브르스쿨 축제가 열리는 해.  \r\n전교생이 축제를 준비하는 장기 프로젝트에 돌입한다.\r\n올해 축제 컨셉은 가장무도회!  \r\n\r\n쥬쥬는 가장무도회에 걸맞은 무대 디자인, \r\n마고는 축제에 쓰일 핑거푸드,\r\n베키와 리나는 초대 가수 섭외, \r\n케이는 패션쇼와 친구들의 드레스를 디자인을 맡게 되는데    \r\n\r\n쥬쥬에게는 특별한 미션이 하나 더 주어진다.\r\n괴상한 천재 프로그래머 타로가 개발한 가상커뮤니티 ‘시크릿플래닛’ 의 디자인을 담당하는 것.\r\n쥬쥬는 타로와의 근사한 팀 작업을 상상했지만 \r\n막상 만나보니 타로는 교내에 퍼진 소문보다 더 괴팍하고 이상하다.\r\n하나부터 열까지 맞는 게 없어 서로 다투다 심한 말까지 하게 되는데\r\n\r\n마고, 베키, 리나 역시 각각 어려움에 처한다. \r\n핑거푸드를 개발하던 마고는 새로 온 수셰프에게 매번 혼이 나자 \r\n자신의 진로를 수정해야 하는 건 아닌지 고민에 빠지고 \r\n\r\n베키는 풋살부 선배 에이든과 본격적인 교제를 시작하지만\r\n모든 걸 에이든에게 맞추는 스스로를 용납하기 힘들다. \r\n\r\n리나는 축제 무대에서 선보일 곡 작업 때문에 한껏 예민해져서\r\n케이와 심하게 다투기까지 한다.\r\n\r\n하지만 쥬쥬, 마고, 베키, 리나는 서로에게 영감을 주며 각자의 어려움을 해결해 나간다.\r\n마침내 다가온 챠브르 축제에서\r\n마고는 자신의 핑거푸드로 수셰프에게 인정받아 자신감을 되찾고,\r\n베키는 ‘나’ 다운 매력으로 에이든의 마음을 다시 사로잡고,\r\n리나는 멋지게 축제 공연을 마치고 나서 드레스를 만들어 준 케이와 함께 시간을 보낸다.\r\n\r\n한편, 타로를 오해하고 심한 말까지 했던 쥬쥬는 축제의 끝자락에 타로와 극적으로 만나 사과의 대화를 나누며 달빛 아래 둘만의 왈츠를 춘다. \t\t\t\t\t\t\t\t",
