    ott: "TVING",
    description:
      "[47년간 한 번도 법을 어기지 않고 살아왔다.\r\n하지만, 오늘부터는 살인귀다. 아아......]\r\n\r\n사람이 사람을 죽였을 때, 대체 어떤 기분일까를 \r\n보잘것없는 회사원, 47세의 ′토스 테츠오′는\r\n울컥울컥 피를 쏟아내는 사체를 앞에 두고 생각하고 있었다──.\r\n\r\n시간을 거슬러 올라 겨우 몇 시간 전.\r\n\r\n테츠오는 반항기의 딸 ′레이카′에게 경원시 되었지만 \r\n사랑하는 아내 카센과 함께 그녀의 성장을 누구보다도 바라며 일상을 보내고 있었다.\r\n\r\n어느 날, 테츠오가 독립해 자취를 시작한 레이카를 찾아갔을 때 \r\n딸의 얼굴에는 맞아서 생긴 듯한 멍이 있었다.\r\n추궁했지만 레이카는 제대로 대답하지 않았다.\r\n\r\n굳게 결심한 테츠오는 레이카의 집에 몰래 들어가 옷장에 몸을 숨긴다.\r\n그리고 보게 된 것이 레이카에게 손을 올린 ′조직원′인 남자친구 ′마토리 노부토′.\r\n게다가 노부토는 전 여자친구를 때려 죽인 과거가 있었고 조직원들과 함께\r\n레이카를 노리는 ′어떤 계획′을 진행하고 있는 초 위험인물이었다──!\r\n\r\n[레이카만큼은 지켜야 해.\r\n설령 우리 부부에게 최악의 결말이 찾아오더라도......]\r\n\r\n사랑하는 가족을 위해 ′평범하고 약한 아저씨′는\r\n뒷세계의 실력자들을 상대로 \r\n목숨과 지혜를 건 싸움을 시작한다!\r\n\r\n",
